const Home = () => {

    return (
        <div>
            <h1 className="display-4 text-primary mt3">Welcome to Capgemini</h1>
            <p>Capgemini trainees, especially those who are from Oct 12 batch3 are really very genious!</p>
            <div>
                <img width="1080" src="https://www.teahub.io/photos/full/80-801743_full-hd-3d-plain-background.jpg" alt="Capgemini Office"></img>
            </div>
        </div>
    );
}

export default Home;
